import React from 'react';
import ItemHeader from '../ItemHeader';

import './style.css';

export default function Header() {
    return (
        <div className="box">
            <ItemHeader 
                imagem="./assets/images/logo-trigg.png"
                imagemicon="./assets/images/Shape.svg"
                imagemenu="./assets/images/menu.png"
            />
        </div>
    );
}
